import React, { Component } from 'react'

class Welcome extends Component {
  constructor (props) {
    super(props)
    this.state = {
      name: 'nandini'
    }
  }

  render () {
    return (
      <h1>Hello Nandini {this.state.name}</h1>
    )
  }
}

export default Welcome
